myObj = {"name":"One thing that makes you a better friend","lyrics":[{"t": "0","d": "1080","l": "Do you ever do this?"},{"t": "1080","d": "5140","l": "Be hella excited that all episodes of your show 'Youth and Consequences' come out on YouTube Red on March 7th?"},{"t": "6220","d": "2020","l": "Well yes, obviously, thank you."},{"t": "8240","d": "4600","l": "But until March 7th when you can binge all episodes of Youth and Consequences on YouTube Red,"},{"t": "12840","d": "5200","l": "I'm talking about when a friend discusses their problems with you. Do you immediately say:"},{"t": "18220","d": "1280","l": "Oh, you know what you should do?"},{"t": "19840","d": "5680","l": "I've noticed recently that I have a pattern. I offer unsolicited advice all the time"},{"t": "25520","d": "1440","l": "when my friends have problems."},{"t": "26960","d": "1640","l": "And I know the intentions are good,"},{"t": "28600","d": "2540","l": "because when we see someone we care about suffering,"},{"t": "31140","d": "4040","l": "our impulse is to, like, help and to fix them and to give them anything that they need."},{"t": "35860","d": "3480","l": "But the more that I do this, the more withdrawn my friends become."},{"t": "39340","d": "4720","l": "Their eyes glaze over, they sort of nod automatically, there's this wall put up between us."},{"t": "44340","d": "5720","l": "So I decided to try not giving any advice unless it was specifically asked of me."},{"t": "50520","d": "2820","l": "And it made me realize just how much I wanna do that all the time,"},{"t": "53360","d": "1700","l": "even in really little ways."},{"t": "55060","d": "940","l": "Have you tried yoga?"},{"t": "56000","d": "2760","l": "Ooh, I just saw a great TED talk on that, I'll send it to you."},{"t": "58760","d": "2340","l": "I had the same exact problem, let me tell you what I did."},{"t": "61100","d": "2000","l": "You know, you should really try yoga."},{"t": "63100","d": "6560","l": "But I resisted the temptation to solve all of my friends' problems and instead would try to really explore their feelings"},{"t": "69660","d": "1740","l": "by asking them questions like:"},{"t": "71440","d": "1020","l": "How does that make you feel?"},{"t": "72460","d": "2440","l": "Wow that sounds really hard. How are you handling it?"},{"t": "74900","d": "3140","l": "I totally understand why you're upset. What do you think you're gonna do?"},{"t": "78040","d": "1100","l": "And something happened."},{"t": "79140","d": "4780","l": "My conversations became so much more engaging and deep and fulfilling."},{"t": "83920","d": "2600","l": "Instead of feeling like I had to fix everything,"},{"t": "86520","d": "3440","l": "I just let myself be a sounding board for whatever someone was feeling."},{"t": "90180","d": "1880","l": "And really tried to explore that."},{"t": "92500","d": "2200","l": "And my friendships changed dramatically."},{"t": "95100","d": "2980","l": "They felt more loving, more personal, and more open."},{"t": "98080","d": "2760","l": "Now, I have this one friend who's a conversational narcissist."},{"t": "100840","d": "3620","l": "It's like, no matter what you say, he will bring the conversation back to himself."},{"t": "104460","d": "3220","l": "And I used to harbour a lot of resentment for it, but it's y'know,"},{"t": "107680","d": "2860","l": "it's one of those annoying quirks and flaws about a person that you love"},{"t": "110540","d": "1680","l": "that you just sort of put up with because you love them."},{"t": "112220","d": "4280","l": "So I thought implementing this with him was going to be particularly interesting."},{"t": "116840","d": "3960","l": "And I found that we would dive so deeply into his problems,"},{"t": "120800","d": "5200","l": "and I would let him express everything he was feeling about every single thing that he had to say"},{"t": "126000","d": "3760","l": "and would just keep the spotlight on him to the point that he sort of like,"},{"t": "129940","d": "4040","l": "ran out of stuff to say about himself, and then would turn the conversation to me."},{"t": "134280","d": "3820","l": "And be fully present with me, and let me talk out my problems because"},{"t": "138220","d": "1240","l": "he's been sorta spent."},{"t": "139460","d": "4480","l": "Now, maybe you're not like me and you're not a person who offers unsolicited advice all the time"},{"t": "143940","d": "3400","l": "But let me advise you to try this out with your next conversation"},{"t": "147340","d": "2020","l": "Maybe in the next couple of conversations"},{"t": "149420","d": "1040","l": "See how it goes."},{"t": "150460","d": "4340","l": "Be fully present, be really engaged with the person and not thinking about how you're going to respond."},{"t": "154800","d": "4380","l": "I learned many a fascinating things and a lot of my relationships became deeper,"},{"t": "159180","d": "1460","l": "and more amazing because of it."},{"t": "161100","d": "3080","l": "I'm Anna Akana, stay right here for a sponsored message."},{"t": "164640","d": "2320","l": "Thank you to Audible for sponsoring today's episode"},{"t": "166960","d": "3040","l": "Audiobooks are great for helping you be a better you."},{"t": "170000","d": "3500","l": "Whether you want to feel healthier, get motivated, or learn something new."},{"t": "173800","d": "4360","l": "I read roughly 70 books a year, and at least 10 of these are audiobooks that I listen to"},{"t": "178160","d": "2860","l": "while I'm driving, doing laundry or stretching."},{"t": "181020","d": "3260","l": "I'm currently listening to Tiffany Haddish's The Last Black Unicorn"},{"t": "184280","d": "2260","l": "and I am so freakin' proud of her."},{"t": "186540","d": "1920","l": "We did a comedy sketch show together back in the day"},{"t": "188460","d": "3480","l": "And it's been amazing to hear about her journey and how far she's come."},{"t": "192180","d": "3940","l": "With Audible, you get a credit every month, good for any audiobook regardless of price,"},{"t": "196120","d": "2620","l": "and unused credits roll over to the next month."},{"t": "198740","d": "3960","l": "And if by chance you don't like your audiobook, you can exchange it with no questions asked"},{"t": "203160","d": "4520","l": "You can go to audible.com/anna or text anna to 500-500"},{"t": "208160","d": "1860","l": "to start your free 30-day trial"},{"t": "210360","d": "4280","l": "That's audible.com/anna or text Anna to 500-500"},{"t": "0","d": "1080","l": "你有這樣過嗎？"},{"t": "1080","d": "5140","l": "很興奮你主演的電視節目「Youth and Consequences」3 月 7 日要在 YouTube Red 上播出了"},{"t": "6220","d": "2020","l": "當然，謝謝"},{"t": "8240","d": "4600","l": "3 月 7 日後你們就可以在 YouTube Red 上收看「Youth and Consequences」了，"},{"t": "12840","d": "5200","l": "但在這之前我要先談論一下，當朋友找你聊困難時該怎麼做"},{"t": "18220","d": "1280","l": "你會不會馬上對朋友說「噢你知道你該這樣做」"},{"t": "19840","d": "5680","l": "我最近發現我有個習慣"},{"t": "25520","d": "1440","l": "當朋友有困難時，我每次都會自主給意見"},{"t": "26960","d": "1640","l": "我知道這個動機是好的，"},{"t": "28600","d": "2540","l": "因為當我們看見在乎的人正在受苦，"},{"t": "31140","d": "4040","l": "我們的直接反應就是幫助他們解決煩惱，並提供任何他們需要的東西"},{"t": "35860","d": "3480","l": "但我越是這麼做，我的朋友們就變得越退縮"},{"t": "39340","d": "4720","l": "他們眼神變呆滯、一直點頭，我們之前有了一道牆"},{"t": "44340","d": "5720","l": "所以我決定，除非對方主動問我，不然我不要提供意見"},{"t": "50520","d": "2820","l": "這讓我了解自己每次都多麽愛提供意見，"},{"t": "53360","d": "1700","l": "即使在小地方也是"},{"t": "55060","d": "940","l": "「你試過瑜伽嗎？」"},{"t": "56000","d": "2760","l": "「噢，我有看過一部 TED 影片在討論這個，我傳給你。」"},{"t": "58760","d": "2340","l": "「我也發生過一樣的問題，讓我告訴你我怎麼做的。」"},{"t": "61100","d": "2000","l": "「你知道嗎？你真的應該嘗試瑜伽。」"},{"t": "63100","d": "6560","l": "我抵擋住這樣的念頭，不急著幫朋友解決困難，而是試圖了解他們的感受"},{"t": "69660","d": "1740","l": "問他們一些問題像是："},{"t": "71440","d": "1020","l": "「這讓你感覺如何？」"},{"t": "72460","d": "2440","l": "「聽起來很難受，你怎麼處理它？」"},{"t": "74900","d": "3140","l": "「我完全明白你為什麼難過，你打算怎麼做？」"},{"t": "78040","d": "1100","l": "然後事情改變了"},{"t": "79140","d": "4780","l": "我的談話變得更深入、有意義"},{"t": "83920","d": "2600","l": "不是覺得我要解決一切問題，"},{"t": "86520","d": "3440","l": "而是讓自己成為別人感受的共振板"},{"t": "90180","d": "1880","l": "然後嘗試去探索體會"},{"t": "92500","d": "2200","l": "我的友誼劇烈改變"},{"t": "95100","d": "2980","l": "朋友們感覺更有愛、更親近、對我更開放"},{"t": "98080","d": "2760","l": "我有個朋友，他在聊天上很自戀"},{"t": "100840","d": "3620","l": "無論你說什麼，他總是會把話題帶回自己身上"},{"t": "104460","d": "3220","l": "我曾經對此心懷厭惡，但是，"},{"t": "107680","d": "2860","l": "這就像你所愛的人的怪僻跟缺點"},{"t": "110540","d": "1680","l": "你都會忍讓，因為你愛他們"},{"t": "112220","d": "4280","l": "所以我覺得把這招用在他身上會特別有趣"},{"t": "116840","d": "3960","l": "而且我發現我們可以深入地討論他的問題，"},{"t": "120800","d": "5200","l": "我會讓他盡情表達所有感受，讓他想說什麼就說"},{"t": "126000","d": "3760","l": "讓聚光燈集中在他身上，直到他"},{"t": "129940","d": "4040","l": "該講的都講完，此時對話內容就會轉移到我身上了"},{"t": "134280","d": "3820","l": "然後他會非常專心聽我說話，讓我談論我的問題"},{"t": "138220","d": "1240","l": "因為他已經沒話要說了"},{"t": "139460","d": "4480","l": "說不定你跟我不一樣，你也不會總是自主提供意見"},{"t": "143940","d": "3400","l": "但我想建議你們下次對話試試這招"},{"t": "147340","d": "2020","l": "之後幾次對話"},{"t": "149420","d": "1040","l": "看看結果如何"},{"t": "150460","d": "4340","l": "專心當下、致力於對談中，不要去想怎麼回應"},{"t": "154800","d": "4380","l": "我學到很多美好的事，因為這個方法，"},{"t": "159180","d": "1460","l": "我的許多感情變得更深入更棒"},{"t": "161100","d": "3080","l": "我是 Anna Akana，別轉走看看贊助"},{"t": "164640","d": "2320","l": "謝謝 Audible 贊助此部影片"},{"t": "166960","d": "3040","l": "有聲書能幫助你成為更好的人"},{"t": "170000","d": "3500","l": "無論你想變得更健康、更有動力、或是學習新知識"},{"t": "173800","d": "4360","l": "我一年讀大約 70 本書，其中至少 10 本是有聲書"},{"t": "178160","d": "2860","l": "我都在開車、洗衣服、或是拉筋的時候聽"},{"t": "181020","d": "3260","l": "我最近在聽 Tiffany Haddish 的「最後的黑獨角獸」"},{"t": "184280","d": "2260","l": "我替她感到非常驕傲"},{"t": "186540","d": "1920","l": "我們那天一同做了喜劇節目"},{"t": "188460","d": "3480","l": "很榮幸聽到她的故事及經歷"},{"t": "192180","d": "3940","l": "在 Audible，你每個月可以得到點數，任何價錢的有聲書都適用，"},{"t": "196120","d": "2620","l": "沒用完的點數可以累積到下個月"},{"t": "198740","d": "3960","l": "萬一你不喜歡購買的有聲書，你可以無條件換貨"},{"t": "203160","d": "4520","l": "你可以去 audible.com/anna 或者輸入 anna 至 500-500"},{"t": "208160","d": "1860","l": "開始享有 30 天免費試用"},{"t": "210360","d": "4280","l": "去 audible.com/anna 或者輸入 anna 至 500-500"}
]}
