myObj = {"name":"Why Is the Mona Lisa So Famous?","lyrics":[{"t": "949","d": "1419","l": "- [Narrator] Let's play a game."},{"t": "2368","d": "2240","l": "Think of a famous painting."},{"t": "4608","d": "833","l": "Guess what?"},{"t": "5441","d": "2037","l": "You just thought of me."},{"t": "7478","d": "2309","l": "Today, I'm the world's most renowned work of art,"},{"t": "9787","d": "1909","l": "but it wasn't always this way."},{"t": "11696","d": "2349","l": "My story is full of surprises,"},{"t": "14045","d": "2804","l": "and it all began in a studio in Florence."},{"t": "16849","d": "3500","l": "(upbeat orchestral music)"},{"t": "24090","d": "3479","l": "Well, here's the master himself, Leonardo da Vinci."},{"t": "27569","d": "2467","l": "He worked on me on and off for a few years"},{"t": "30036","d": "1456","l": "towards the end of his career."},{"t": "31492","d": "1331","l": "- You're a minor work, my dear,"},{"t": "32823","d": "1801","l": "some interesting shading, nothing more."},{"t": "34624","d": "2552","l": "- [Narrator] We'll just see about that."},{"t": "37176","d": "3679","l": "Over the next 300 years, I hung quietly in French palaces"},{"t": "40855","d": "1811","l": "and royal bathrooms."},{"t": "42666","d": "1497","l": "The things I've seen."},{"t": "44163","d": "2282","l": "- [Napoleon] I want you."},{"t": "46445","d": "2151","l": "- [Narrator] Until finally I was noticed by a man who had"},{"t": "48596","d": "2773","l": "already made quite a name for himself."},{"t": "51369","d": "2115","l": "When Napoleon chose me to hang on his bedroom wall,"},{"t": "53484","d": "1638","l": "people took notice."},{"t": "55122","d": "2260","l": "- I look forward to sleeping with you, my cherie."},{"t": "57382","d": "2248","l": "- [Narrator] After he had his whole exile from France thing,"},{"t": "59630","d": "3130","l": "they tossed me on a wall at The Louvre."},{"t": "62760","d": "1940","l": "But at this point, I was still"},{"t": "64700","d": "2989","l": "just another Renaissance portrait."},{"t": "67689","d": "1170","l": "Until one night."},{"t": "68859","d": "3833","l": "(daunting, suspenseful music)"},{"t": "73988","d": "1162","l": "- Bella."},{"t": "75150","d": "1187","l": "- [Narrator] I was stolen!"},{"t": "76337","d": "1128","l": "It was pandemonium."},{"t": "77465","d": "1750","l": "Paris was in an uproar."},{"t": "79215","d": "2850","l": "The police hauled people in left and right."},{"t": "82065","d": "1320","l": "The hysteria hit a fever pitch"},{"t": "83385","d": "1941","l": "when the police suspected and interrogated"},{"t": "85326","d": "3959","l": "one of the most famous artists in the world, Pablo Picasso."},{"t": "89285","d": "1503","l": "(officer speaking French) (man gasping)"},{"t": "90788","d": "1442","l": "But Picasso was innocent."},{"t": "92230","d": "2904","l": "The thief turned out to be an Italian carpenter."},{"t": "95134","d": "1891","l": "He was caught in Florence."},{"t": "97025","d": "833","l": "- Mama mia."},{"t": "97858","d": "2732","l": "- [Narrator] And I returned to The Louvre."},{"t": "100590","d": "1869","l": "From that day forward, I became the darling"},{"t": "102459","d": "1680","l": "of the art world."},{"t": "104139","d": "2220","l": "Everyone wanted to see Napoleon's da Vinci painting"},{"t": "106359","d": "2531","l": "Picasso was suspected of stealing."},{"t": "108890","d": "2431","l": "Soon, tourists crowded in and most people forgot"},{"t": "111321","d": "2429","l": "why I was famous in the first place."},{"t": "113750","d": "1961","l": "That might raise some eyebrows, but not mine"},{"t": "115711","d": "1532","l": "since I don't have any."},{"t": "117243","d": "2655","l": "Oh, you didn't notice I don't have any eyebrows?"},{"t": "119898","d": "3193","l": "I told you, I'm full of surprises."},{"t": "123091","d": "3083","l": "(soft chiming music)"},{"t": "949","d": "1419","l": "- [旁白] 我們來玩一個遊戲"},{"t": "2368","d": "2240","l": "想一幅有名的畫作"},{"t": "4608","d": "833","l": "知道嗎?"},{"t": "5441","d": "2037","l": "你想到的是我"},{"t": "7478","d": "2309","l": "現在我是全世界最有名的畫作"},{"t": "9787","d": "1909","l": "但以前並不是這樣的"},{"t": "11696","d": "2349","l": "我的故事充滿驚奇"},{"t": "14045","d": "2804","l": "而這一切都要從佛羅倫斯的一間畫室裡說起"},{"t": "16849","d": "3500","l": "(管弦樂間奏)"},{"t": "24090","d": "3479","l": "這是大師李奧納多·達文西本人"},{"t": "27569","d": "2467","l": "他陸陸續續地花了好幾年畫我"},{"t": "30036","d": "1456","l": "一直到他職業生涯結束"},{"t": "31492","d": "1331","l": "- 親愛的，你是個小作品"},{"t": "32823","d": "1801","l": "除了一些有趣的陰影外，沒什麼特別的"},{"t": "34624","d": "2552","l": "- [旁白] - 我們就等著看吧"},{"t": "37176","d": "3679","l": "接下來的 300 年，我被靜靜地掛在法國的城堡裡"},{"t": "40855","d": "1811","l": "還有貴族浴室內"},{"t": "42666","d": "1497","l": "我看過許多難以啟齒的事"},{"t": "44163","d": "2282","l": "- (拿破崙) 我想要你"},{"t": "46445","d": "2151","l": "- [旁白] 直到有一天一個小有名氣的人"},{"t": "48596","d": "2773","l": "注意到了我"},{"t": "51369","d": "2115","l": "拿破崙選擇將我掛在他臥室牆上"},{"t": "53484","d": "1638","l": "這引起了人們的注意"},{"t": "55122","d": "2260","l": "- 親愛的，我想和你睡在一起"},{"t": "57382","d": "2248","l": "- [旁白] 等到他被法國流放"},{"t": "59630","d": "3130","l": "他們將我扔在羅浮宮的牆上"},{"t": "62760","d": "1940","l": "但在這時候，"},{"t": "64700","d": "2989","l": "我只不過是一幅文藝復興時期的畫作"},{"t": "67689","d": "1170","l": "直到有一天晚上"},{"t": "68859","d": "3833","l": "(令人卻步, 緊張的音樂)"},{"t": "73988","d": "1162","l": "- 不錯"},{"t": "75150","d": "1187","l": "- [旁白] 我被偷了！"},{"t": "76337","d": "1128","l": "這簡直是地獄"},{"t": "77465","d": "1750","l": "巴黎陷入一片混亂"},{"t": "79215","d": "2850","l": "警方到處約談人們"},{"t": "82065","d": "1320","l": "這件事後來進入了白熱化"},{"t": "83385","d": "1941","l": "因為警方懷疑並且約談了"},{"t": "85326","d": "3959","l": "世界上最有名的畫家之一，畢卡索"},{"t": "89285","d": "1503","l": "(官員講著法文) (他嘆息著)"},{"t": "90788","d": "1442","l": "但畢卡索是無辜的"},{"t": "92230","d": "2904","l": "小偷是一名義大利木匠"},{"t": "95134","d": "1891","l": "他在佛羅倫斯被捕"},{"t": "97025","d": "833","l": "- 我的天啊"},{"t": "97858","d": "2732","l": "- [旁白]- 之後我就回到了羅浮宮"},{"t": "100590","d": "1869","l": "在那天以後，我變成了"},{"t": "102459","d": "1680","l": "藝術界的寵兒"},{"t": "104139","d": "2220","l": "每個人都想看達文西所畫的"},{"t": "106359","d": "2531","l": "畢卡索遭控涉嫌偷竊的畫作"},{"t": "108890","d": "2431","l": "很快地，觀光客湧入，而大部分人都忘了"},{"t": "111321","d": "2429","l": "一開始我為何會那麼有名"},{"t": "113750","d": "1961","l": "這可能會使人們眉頭一皺，但我不會"},{"t": "115711","d": "1532","l": "因為我沒有眉毛"},{"t": "117243","d": "2655","l": "哦，你沒注意到嗎？"},{"t": "119898","d": "3193","l": "我告訴過你，我充滿驚奇"},{"t": "123091","d": "3083","l": "(和諧悅耳的音樂)"}
]}
