myObj = {"name":"How Different People Spend $100","lyrics":[{"t": "361","d": "1433","l": "Am I in the right spot?"},{"t": "1794","d": "1304","l": "(baby crying)"},{"t": "3098","d": "1224","l": "There we go."},{"t": "4322","d": "1510","l": "It's kind of awkward."},{"t": "5832","d": "2611","l": "(upbeat music)"},{"t": "8443","d": "1925","l": "I would say I'm really striving"},{"t": "10368","d": "3329","l": "to be middle class, but I don't know if I am quite yet."},{"t": "13697","d": "2462","l": "I live on campus with"},{"t": "16159","d": "1637","l": "three other girls."},{"t": "17796","d": "2410","l": "We met online and"},{"t": "20206","d": "2341","l": "it was love at first email."},{"t": "22547","d": "4095","l": "I am married and I have two kids."},{"t": "26642","d": "4983","l": "(upbeat music)"},{"t": "33937","d": "1714","l": "What does $100 mean to you?"},{"t": "35651","d": "2443","l": "$100 means food for a week."},{"t": "38094","d": "1830","l": "A hundred bucks means"},{"t": "39924","d": "2996","l": "like a couple days worth of money, or"},{"t": "42920","d": "3574","l": "one frivolous night of indulgence."},{"t": "46494","d": "2409","l": "There are families back in India"},{"t": "48903","d": "3604","l": "for whom that's like the monthly incomes."},{"t": "52507","d": "2340","l": "Before I had kids, I didn't grocery shop."},{"t": "54847","d": "4813","l": "Having kids now, is (laughs) crazy at times."},{"t": "59660","d": "2568","l": "(baby yells) Stay still."},{"t": "62228","d": "2860","l": "Money means getting by."},{"t": "65088","d": "988","l": "Are you guys unemployed?"},{"t": "66076","d": "2086","l": "Yeah, unemployed."},{"t": "68162","d": "3516","l": "Starving artists sort of thing, I think, yeah."},{"t": "71678","d": "2941","l": "My parents are extremely tight"},{"t": "74619","d": "1397","l": "with money, yes."},{"t": "76016","d": "896","l": "Do you feel like you're the same?"},{"t": "76912","d": "1103","l": "No."},{"t": "78015","d": "1895","l": "Yes, I collect Social Security."},{"t": "79910","d": "1889","l": "Not near enough, by the way."},{"t": "81799","d": "3978","l": "I get $1,100 a month, puts me pretty close to,"},{"t": "85777","d": "1800","l": "if not under, the poverty level."},{"t": "87577","d": "3660","l": "I would say I drink probably"},{"t": "92557","d": "1270","l": "at least six days a week."},{"t": "93827","d": "1493","l": "I think we've been out to eat"},{"t": "95320","d": "2968","l": "twice in the last year. Mexican food and Pizza."},{"t": "98288","d": "1919","l": "Usually every day I have pizza rolls,"},{"t": "100207","d": "2000","l": "pizza related stuff."},{"t": "102207","d": "1103","l": "Why?"},{"t": "103310","d": "1306","l": "'Cause it's pizza."},{"t": "104616","d": "1231","l": "I'm always thinking budget."},{"t": "105847","d": "2074","l": "I mean, I'm thinking practical."},{"t": "107921","d": "1521","l": "If I'm feeling tight on money,"},{"t": "109442","d": "2032","l": "that definitely causes stress."},{"t": "111474","d": "2172","l": "I don't think I'm good with money at all."},{"t": "115536","d": "1759","l": "Does somebody have a wine key?"},{"t": "117295","d": "1018","l": "Are you serious?"},{"t": "118313","d": "1838","l": "Are you gonna (laughs),"},{"t": "120151","d": "1306","l": "It's kinda like,"},{"t": "361","d": "1433","l": "我的位置對嗎？"},{"t": "1794","d": "1304","l": "(嬰兒哭聲)"},{"t": "3098","d": "1224","l": "好了"},{"t": "4322","d": "1510","l": "感覺有點怪"},{"t": "5832","d": "2611","l": "(歡愉的音樂)"},{"t": "8443","d": "1925","l": "我會說我真的很努力"},{"t": "10368","d": "3329","l": "我會說我真的很努力"},{"t": "13697","d": "2462","l": "我和其他三個女孩"},{"t": "16159","d": "1637","l": "一起住校"},{"t": "17796","d": "2410","l": "我們在網路上認識的"},{"t": "20206","d": "2341","l": "第一次互通 email 我們就戀愛了"},{"t": "22547","d": "4095","l": "我已婚有兩個小孩"},{"t": "26642","d": "4983","l": "(歡愉的音樂)"},{"t": "33937","d": "1714","l": "一百美元在你心目中的價值是什麼？"},{"t": "35651","d": "2443","l": "一百元代表一星期的食物"},{"t": "38094","d": "1830","l": "一百塊錢意味著"},{"t": "39924","d": "2996","l": "可以用錢換得的幾天，或者"},{"t": "42920","d": "3574","l": "一個恣意放縱的夜晚"},{"t": "46494","d": "2409","l": "對印度的家庭而言"},{"t": "48903","d": "3604","l": "它是一個月的薪水"},{"t": "52507","d": "2340","l": "在我有孩子之前，我根本不去超市買東西"},{"t": "54847","d": "4813","l": "現在有了孩子，有時候感覺快瘋了"},{"t": "59660","d": "2568","l": "(小寶寶大叫) 不要亂動"},{"t": "62228","d": "2860","l": "錢意味著過生活"},{"t": "65088","d": "988","l": "你們失業了嗎？"},{"t": "66076","d": "2086","l": "對，失業了"},{"t": "68162","d": "3516","l": "有點像是潦倒的藝術家，我覺得"},{"t": "71678","d": "2941","l": "是的，我的父母對金錢"},{"t": "74619","d": "1397","l": "很摳"},{"t": "76016","d": "896","l": "你認為你和他們一樣嗎？"},{"t": "76912","d": "1103","l": "不"},{"t": "78015","d": "1895","l": "對，我領社會補助金"},{"t": "79910","d": "1889","l": "順便一提，根本不夠用"},{"t": "81799","d": "3978","l": "我每月領 1,100 美元，這種收入使我就算沒有低於，也非常接近"},{"t": "85777","d": "1800","l": "貧窮水準了"},{"t": "87577","d": "3660","l": "我會說，我大概一星期裡"},{"t": "92557","d": "1270","l": "有六天都在喝酒"},{"t": "93827","d": "1493","l": "我去年有兩次"},{"t": "95320","d": "2968","l": "吃外食經驗，墨西哥美食和披薩"},{"t": "98288","d": "1919","l": "我通常每天吃披薩小卷"},{"t": "100207","d": "2000","l": "或是和披薩相關的食物"},{"t": "102207","d": "1103","l": "為什麼？"},{"t": "103310","d": "1306","l": "因為我就愛披薩"},{"t": "104616","d": "1231","l": "我總是考慮預算"},{"t": "105847","d": "2074","l": "我的意思是，我考慮現實問題"},{"t": "107921","d": "1521","l": "如果我錢不夠用"},{"t": "109442","d": "2032","l": "那肯定會有壓力"},{"t": "111474","d": "2172","l": "我認為我根本不善於理財"},{"t": "115536","d": "1759","l": "誰有開瓶器？"},{"t": "117295","d": "1018","l": "當真嗎？"},{"t": "118313","d": "1838","l": "你打算幹嘛 (笑聲)"},{"t": "120151","d": "1306","l": "有點像這麼回事"}
]}
