myObj = {"name":"Things You Should NEVER Do In Other Countries!","lyrics":[{"t": "89","d": "2830","l": "Why is touching somebody on the head in Thailand taboo?"},{"t": "2919","d": "2421","l": "Why can’t you chew gum in Singapore?"},{"t": "5340","d": "3520","l": "And just why can’t you order a white coffee in Italy in the afternoon?"},{"t": "8860","d": "3870","l": "Every country and region around the world has their own individual set of cultural rules"},{"t": "12730","d": "2180","l": "that help society run smoothly."},{"t": "14910","d": "4450","l": "As a tourist, we can sometimes break those rules unknowingly and find ourselves embarrassed"},{"t": "19360","d": "2080","l": "or even in serious legal trouble."},{"t": "21440","d": "4450","l": "So it is usually best to read up on the cultural norms, and if in doubt, look around and observe"},{"t": "25890","d": "2280","l": "how the locals behave, and do likewise."},{"t": "28170","d": "3791","l": "Today we’ll take a closer look at some of these dos and don'ts, in this episode of the"},{"t": "31961","d": "3959","l": "Infographics Show, Things You Should Never Do in Other Countries."},{"t": "35920","d": "2330","l": "Smiling at people in Russia might get you into trouble."},{"t": "38250","d": "4180","l": "In Russia, smiling is considered an intimate gesture, so to crack a smile without knowing"},{"t": "42430","d": "3820","l": "someone first would be considered overstepping personal boundaries."},{"t": "46250","d": "4579","l": "Never ever present someone with an even number of flowers, as this is reserved for memorials"},{"t": "50829","d": "2521","l": "and will be taken as a gesture of impending doom."},{"t": "53350","d": "3450","l": "So if you fall in love in Russia, and decide to make your first move with a bouquet of"},{"t": "56800","d": "4279","l": "flowers, make sure you’re not smiling and the flowers are an odd number or else you"},{"t": "61079","d": "2181","l": "won’t be receiving much love from Russia."},{"t": "63260","d": "3920","l": "In India, you should definitely not shake somebody’s hand, handle money, or handle"},{"t": "67180","d": "5389","l": "food at the market using your left hand, as this hand is the unclean one of the pair,"},{"t": "72569","d": "2671","l": "and the one used for wiping in the bathroom."},{"t": "75240","d": "3890","l": "Also while in India, refrain from any signs of physical affection of the opposite sex"},{"t": "79130","d": "4169","l": "in public, as there are strict rules against kissing and touching in public, which is kinda"},{"t": "83299","d": "3161","l": "strange coming from the country who introduced the Kama Sutra to the world."},{"t": "86460","d": "4839","l": "Also, don’t be offended by the lack of lining up in public places, as the concept of standing"},{"t": "91299","d": "4070","l": "in line and waiting patiently is typically a Western construct."},{"t": "95369","d": "4051","l": "Japan surely has the best sushi in the world, but if you leave a tip at your favorite restaurant"},{"t": "99420","d": "4759","l": "in Tokyo, the service staff may see it as degrading, almost like an implication that"},{"t": "104179","d": "1341","l": "you think they’re poor."},{"t": "105520","d": "3599","l": "And if you happen to be in a restaurant in China, leave a little food on the plate as"},{"t": "109119","d": "3621","l": "a compliment to the chef, otherwise he’ll think he hasn’t provided enough food for"},{"t": "112740","d": "1000","l": "you to eat."},{"t": "113740","d": "4799","l": "Over in Italy, never order a cappuccino at a restaurant after 11am, as this is considered"},{"t": "118539","d": "2080","l": "a major break of etiquette."},{"t": "120619","d": "3860","l": "Italians are obsessed with digestion, and consuming milk after a meal, according to"},{"t": "124479","d": "4200","l": "Italian logic, will mess up your digestion, so make sure you drink all the milk you want"},{"t": "128679","d": "1851","l": "at breakfast and not after."},{"t": "130530","d": "4099","l": "Unless that is, you are in a super touristy area where milk after breakfast is acceptable."},{"t": "134629","d": "3401","l": "In Singapore, it is illegal to feed birds in public."},{"t": "138030","d": "2120","l": "How can feeding the pigeons be a bad thing?"},{"t": "140150","d": "4130","l": "Well, Singaporeans are proud of the cleanliness of their city, and if the birds are able to"},{"t": "144280","d": "4849","l": "survive in the city they are welcome, but constant feeding will cause numbers to skyrocket,"},{"t": "149129","d": "4321","l": "and with pigeons come pigeon poop, and that takes some cleaning to remove from buildings."},{"t": "153450","d": "4539","l": "It is also illegal to throw litter on the street in Singapore and chewing gum has been"},{"t": "157989","d": "4711","l": "banned from entering the country since 2004, so if you are planning a trip, leave the Juicy"},{"t": "162700","d": "1200","l": "Fruit at home."},{"t": "163900","d": "4350","l": "In most Southeast Asian countries, it is very rude to touch somebody on the head, as this"},{"t": "168250","d": "3250","l": "is the most sacred part of the body, according to Buddhist belief."},{"t": "171500","d": "4230","l": "It follows that the feet are the dirtiest part, so never sit with your feet up and/or"},{"t": "175730","d": "1179","l": "pointing at somebody."},{"t": "176909","d": "4450","l": "In Thailand, any conversation about the royal family is usually off limits, and you should"},{"t": "181359","d": "3011","l": "never touch a monk, especially if you happen to be a woman."},{"t": "184370","d": "5679","l": "In south East Asia, it is very bad form to shout, be rude, or put any local in a situation"},{"t": "190049","d": "1481","l": "where they may lose face."},{"t": "191530","d": "4989","l": "Keep in mind, in Thailand alone, there are 14 different types of smiles, and only a handful"},{"t": "196519","d": "4550","l": "of those smiles indicate the person is happy or comfortable with the current situation."},{"t": "201069","d": "5301","l": "In Turkey, the Ok sign using the thumb and forefinger is seen as an obscene gesture,"},{"t": "206370","d": "4500","l": "and in Thailand, the reverse victory finger gesture, thought of as a rude gesture in the"},{"t": "210870","d": "4060","l": "UK, is considered fine, and used to express the number two."},{"t": "214930","d": "4360","l": "Also in Thailand, the three finger Hunger Games hand signal was made illegal in public"},{"t": "219290","d": "4660","l": "after student protesters used the hand signal to voice their opposition to military rule."},{"t": "223950","d": "4700","l": "In Germany, using a Nazi hand gesture is a crime, and those doing it will be punished"},{"t": "228650","d": "1009","l": "accordingly."},{"t": "229659","d": "4730","l": "In Malaysia, you should point using only your thumbs, and refrain from pounding one fist"},{"t": "234389","d": "5341","l": "into the other open palm – both finger pointing and fist pounding are considered rude."},{"t": "239730","d": "4530","l": "And in Italy, if you make the universal rock out sign with your pointer and pinky fingers"},{"t": "244260","d": "3970","l": "extended, it means that you think the person you’re directing it at is unfaithful and"},{"t": "248230","d": "1360","l": "cheating on their partner."},{"t": "249590","d": "3920","l": "So be careful while traveling around the world, as one gesture could very well land you in"},{"t": "253510","d": "1000","l": "hot water."},{"t": "254510","d": "4819","l": "Have you ever unknowingly gestured inappropriately in a foreign country and suffered the consequences."},{"t": "259329","d": "1000","l": "Let us know in the comments."},{"t": "260329","d": "3930","l": "Also, be sure to check out our other video called American Behaviors Considered Rude"},{"t": "264259","d": "1000","l": "in Other Countries!"},{"t": "265259","d": "3781","l": "Thanks for watching, and, as always, don’t forget to like, share, and subscribe."},{"t": "269040","d": "580","l": "See you next time!"},{"t": "89","d": "2830","l": "為什麼在泰國碰人家的頭是禁忌？"},{"t": "2919","d": "2421","l": "為什麼在新加坡不能嚼口香糖？"},{"t": "5340","d": "3520","l": "又為什麼不能在義大利的午休時間點白咖啡？"},{"t": "8860","d": "3870","l": "世界上每個國家和地區都有不同的一套文化準則"},{"t": "12730","d": "2180","l": "讓整個社會和諧"},{"t": "14910","d": "4450","l": "當我們出國遊玩，我們有時會無意間犯了禁忌、讓自己難堪"},{"t": "19360","d": "2080","l": "或甚至觸犯了國外的法規"},{"t": "21440","d": "4450","l": "因此出國前最好事先了解當地文化常態，如果不確定有哪些禁忌，可以入境隨俗"},{"t": "25890","d": "2280","l": "觀察當地人怎麼做，並跟著他們做"},{"t": "28170","d": "3791","l": "今天，在這集資訊圖表中，我們來深入討論各國有哪些能做和不能做的事"},{"t": "31961","d": "3959","l": "出國不可不知的各國禁忌"},{"t": "35920","d": "2330","l": "在俄羅斯隨便對人笑可能會為自己惹來麻煩"},{"t": "38250","d": "4180","l": "在俄羅斯，微笑被視為親密的舉動，因此對著還不認識的人笑"},{"t": "42430","d": "3820","l": "可能會被視為一項踰矩的行為"},{"t": "46250","d": "4579","l": "絕對絕對不要送俄羅斯人偶數朵花，因為偶數花束是用在葬禮"},{"t": "50829","d": "2521","l": "當地人認為是非常不吉利的"},{"t": "53350","d": "3450","l": "所以如果你愛上俄羅斯這個國家，想要送花來踏出交際的第一步"},{"t": "56800","d": "4279","l": "記得，不要笑，花束要是單數朵"},{"t": "61079","d": "2181","l": "不然俄羅斯不會歡迎你"},{"t": "63260","d": "3920","l": "在印度，絕對不能和當地人握手或是在超市用左手拿錢、拿食物"},{"t": "67180","d": "5389","l": "因為左手被視為較不乾淨的那隻手"},{"t": "72569","d": "2671","l": "印度人如廁擦屁股也用左手"},{"t": "75240","d": "3890","l": "另外，要避免在公共場合和異性的肢體接觸"},{"t": "79130","d": "4169","l": "因為在印度有嚴格的法規禁止在公共場合親吻和肢體接觸"},{"t": "83299","d": "3161","l": "雖然有點矛盾，因為印度的《慾經》聞名世界"},{"t": "86460","d": "4839","l": "還有，要習慣在公共場合大家沒有排隊的習慣，因為乖乖排隊"},{"t": "91299","d": "4070","l": "並耐心等候算是典型的西方文化"},{"t": "95369","d": "4051","l": "日本不可否認是全世界壽司最好吃的國家，但如果你在東京，你喜歡的餐廳裡留下小費"},{"t": "99420","d": "4759","l": "店員可能會覺得被冒犯到，他們認為給小費是在暗示"},{"t": "104179","d": "1341","l": "他們很缺錢"},{"t": "105520","d": "3599","l": "來到中國的餐廳，記得剩下一點點食物在盤子裡"},{"t": "109119","d": "3621","l": "當作給廚師的稱讚，以免他們覺得準備給客人的食物"},{"t": "112740","d": "1000","l": "不夠多"},{"t": "113740","d": "4799","l": "在義大利，早上 11 點之後不要在餐廳點卡布奇諾，這被視為是"},{"t": "118539","d": "2080","l": "非常不遵守禮儀的"},{"t": "120619","d": "3860","l": "義大利人很重視消化，因此依照義大利人的邏輯，飯後喝牛奶飲品"},{"t": "124479","d": "4200","l": "會消化不良，因此記得要喝牛奶類的話"},{"t": "128679","d": "1851","l": "要飯前喝，不要飯後喝"},{"t": "130530","d": "4099","l": "除非你是在觀光客很多的地區點餐，那早餐後點奶類就沒關係"},{"t": "134629","d": "3401","l": "在新加坡，在公共場合餵鳥是不合法的"},{"t": "138030","d": "2120","l": "但餵鴿子哪裡不好？"},{"t": "140150","d": "4130","l": "新加坡人對他們極乾淨的城市引以為傲，鳥類在城市中生存對新加坡人"},{"t": "144280","d": "4849","l": "是沒問題的，但是餵鳥之後會造成鳥類數量大增"},{"t": "149129","d": "4321","l": "隨之而來是鴿子的糞便，這樣他們就得清理建築物上的糞便"},{"t": "153450","d": "4539","l": "在新加坡隨地丟垃圾也犯法，並從 2004 年開始全面禁止"},{"t": "157989","d": "4711","l": "在路上嚼口香糖，如果你打算去新加坡玩，記得別在外面吃"},{"t": "162700","d": "1200","l": "Fruit at home."},{"t": "163900","d": "4350","l": "在多數東南亞國家，隨便摸別人的頭是很不禮貌的"},{"t": "168250","d": "3250","l": "因為根據佛教信仰，頭部是人體最神聖的部位"},{"t": "171500","d": "4230","l": "反之，腳是最骯髒的部位，因此坐著時絕對不要翹腳，或是"},{"t": "175730","d": "1179","l": "腳朝向別人"},{"t": "176909","d": "4450","l": "在泰國，任何跟皇室家族有關的話題一律被禁止"},{"t": "181359","d": "3011","l": "也千萬不要觸摸到和尚，尤其如果妳是女性"},{"t": "184370","d": "5679","l": "在東南亞，大吼大叫、行為粗魯，或是做出任何讓當地人蒙羞的舉止"},{"t": "190049","d": "1481","l": "都是非常糟糕的"},{"t": "191530","d": "4989","l": "要記得，光在泰國就有 14 種笑容，其中只有幾種微笑"},{"t": "196519","d": "4550","l": "是代表那個人很開心或是滿意現狀"},{"t": "201069","d": "5301","l": "在土耳其，比大拇指及食指圈住的 OK 手勢是有猥褻意味的"},{"t": "206370","d": "4500","l": "在英國，手背朝外的勝利手勢有挑釁意味，但在泰國"},{"t": "210870","d": "4060","l": "這個手勢是沒問題的，單純表達數字二"},{"t": "214930","d": "4360","l": "在泰國，在公開場合比《飢餓遊戲》中的三根手指手勢是不合法的"},{"t": "219290","d": "4660","l": "原因是之前有學生在反抗軍事命令時，比出這個手勢表達立場"},{"t": "223950","d": "4700","l": "在德國，比出納粹手勢是犯法的，會依情形"},{"t": "228650","d": "1009","l": "受到處罰"},{"t": "229659","d": "4730","l": "在馬來西亞，要用大拇指指東西，並要避免用一手拳頭打入另外一隻手掌心"},{"t": "234389","d": "5341","l": "用拇指以外的指頭指東西及打拳頭都被視為是無禮的行為"},{"t": "239730","d": "4530","l": "在義大利，如果你比出世界通用的搖滾手勢，也就是大拇指、食指和小拇指"},{"t": "244260","d": "3970","l": "往外伸，代表你指著的那個人對愛情不忠誠"},{"t": "248230","d": "1360","l": "可能有劈腿或外遇"},{"t": "249590","d": "3920","l": "因此，出國玩要小心，在不同國家比錯手勢很可能會"},{"t": "253510","d": "1000","l": "招來麻煩"},{"t": "254510","d": "4819","l": "你有不小心在國外比錯手勢而惹麻煩上身的經驗嗎？"},{"t": "259329","d": "1000","l": "留言讓我們知道"},{"t": "260329","d": "3930","l": "另外，記得看看我們的另一支影片「美國人的哪些行為在國外"},{"t": "264259","d": "1000","l": "是很無禮的」"},{"t": "265259","d": "3781","l": "謝謝觀看，一樣，別忘記幫我們按讚、分享，及訂閱"},{"t": "269040","d": "580","l": "我們下次見！"}
]}
myJSON = JSON.stringify(myObj);
localStorage.setItem("Z-5zUm8U2o8", myJSON);




myObj = {"name":"Does saving more lives lead to overpopulation?","lyrics":[{"t": "3429","d": "4160","l": "In this year’s Annual Letter, Melinda and I take the toughest questions"},{"t": "7589","d": "3510","l": "we get asked and give our answers."},{"t": "11099","d": "4161","l": "One that’s come up for a long time is, as we make the world healthier,"},{"t": "15260","d": "5920","l": "is the population going to get so big that feeding everybody and maintaining the"},{"t": "21180","d": "3500","l": "environment is going to be impossible?"},{"t": "24680","d": "6030","l": "Here we can see a chart that looks at the total world population"},{"t": "30710","d": "5310","l": "over the last several hundred years, and at first glance this is a bit scary."},{"t": "36020","d": "6590","l": "We go from less than a billion in 1800, and then 3, 4, 5, 6 and 7.4 billion where"},{"t": "42610","d": "3530","l": "we are today is happening even faster."},{"t": "46140","d": "5650","l": "So, Melinda and I wondered whether providing new medicines and keeping children"},{"t": "51790","d": "3830","l": "alive, would that create more of a population problem?"},{"t": "55620","d": "7140","l": "What we found out is that as health improves, families choose to have less children"},{"t": "62760","d": "4480","l": "and this effect is very, very dramatic."},{"t": "67240","d": "4210","l": "We find that in every country of the world, this is repeated."},{"t": "71450","d": "3430","l": "The population growth goes down as we improve health."},{"t": "74880","d": "5250","l": "So, we’ve taken that chart that shows the global population growth"},{"t": "80130","d": "4980","l": "and we’ve actually extended it out all the way to 2100."},{"t": "85110","d": "5410","l": "And we can see that instead of continuing, it actually flattens out."},{"t": "90520","d": "3959","l": "Another way to see that is through this rate of population growth."},{"t": "94479","d": "4140","l": "And you can see that in the 60s that reached a pretty high number,"},{"t": "98619","d": "5401","l": "over 2% per year, and it’s now come way, way down."},{"t": "104020","d": "5669","l": "Now, 11 billion people is still a lot, but the good news is that the faster we improve"},{"t": "109689","d": "4860","l": "health, the faster family size goes down."},{"t": "114549","d": "3601","l": "And so, we can feel great about saving those lives."},{"t": "3429","d": "4160","l": "今年的年度致信中，梅琳達和我挑出幾個最棘手的問題"},{"t": "7589","d": "3510","l": "我們得回答這些問題並提出自己的見解"},{"t": "11099","d": "4161","l": "這是存在已久的問題：當我們將這世界變得更穩定之後"},{"t": "15260","d": "5920","l": "人口的增長是否導致全球的糧食問題"},{"t": "21180","d": "3500","l": "且環境也將會更難以維持穩定？"},{"t": "24680","d": "6030","l": "現在有張圖表顯示出全世界的總人口數"},{"t": "30710","d": "5310","l": "並記錄著過往數百年的人口，乍看之下非常驚人"},{"t": "36020","d": "6590","l": "從 1800 年不到 10 億人口，擴張到 30, 40, 50, 60 甚至是 74 億"},{"t": "42610","d": "3530","l": "時至今日，人口成長更加快速"},{"t": "46140","d": "5650","l": "梅琳達和我懷疑如果研發新藥品，確保孩童身體健康"},{"t": "51790","d": "3830","l": "是否反而會導致人口問題？"},{"t": "55620","d": "7140","l": "我們發現當醫療環境進步後，每個家庭都想要減少生育"},{"t": "62760","d": "4480","l": "這個結果非常令人意外"},{"t": "67240","d": "4210","l": "我們發現世界各地都符合這個結果"},{"t": "71450","d": "3430","l": "當我們改善醫療後人口成長會下降"},{"t": "74880","d": "5250","l": "所以，這圖表顯示了全球的人口成長"},{"t": "80130","d": "4980","l": "人口一路直線成長至 2100 年"},{"t": "85110","d": "5410","l": "圖表顯示人口不再成長，反而逐漸平緩"},{"t": "90520","d": "3959","l": "另一個曲線代表人口成長率"},{"t": "94479","d": "4140","l": "圖表顯示 1960 年代達到一個高峰"},{"t": "98619","d": "5401","l": "每年超過 2% ，接著就直線下滑"},{"t": "104020","d": "5669","l": "現在， 110 億人口仍然很龐大，但好消息是醫療進步越快"},{"t": "109689","d": "4860","l": "家庭規模就越快縮減"},{"t": "114549","d": "3601","l": "結論是，我們還是能夠樂觀地拯救世界的生命"}]}

