myObj = {"name":"Why Leaving Facebook Doesn’t Always Mean Quitting","lyrics":[{"t": "900","d": "3000","l": "If you look at the delete Facebook hashtag, people"},{"t": "3900","d": "1060","l": "are really angry."},{"t": "4960","d": "1670","l": "And I think they’re sort of becoming"},{"t": "6630","d": "2040","l": "aware of the extent to which they’re"},{"t": "8670","d": "1800","l": "being watched and tracked."},{"t": "10470","d": "3750","l": "This feels like it’s a turning point for many of the people"},{"t": "14220","d": "2610","l": "who use Facebook and aren’t happy about how"},{"t": "16830","d": "1290","l": "their data is being used."},{"t": "18120","d": "2400","l": "And the more they find out, the less happy they are."},{"t": "23349","d": "1541","l": "I think people underestimate how hard"},{"t": "24890","d": "6142","l": "it is to untangle ourselves from a social network like Facebook."},{"t": "31032","d": "1958","l": "So before you delete your Facebook account, just"},{"t": "32990","d": "2070","l": "remember that it’s not just Facebook that you’ll"},{"t": "35060","d": "1530","l": "be losing access to."},{"t": "36590","d": "2580","l": "It’s also all of the third-party apps"},{"t": "39170","d": "2760","l": "that you use Facebook to log in to"},{"t": "41930","d": "3120","l": "or that are connected or plugged into your Facebook account."},{"t": "45050","d": "1500","l": "So it’s important before you make"},{"t": "46550","d": "2730","l": "this choice to go through those apps,"},{"t": "49280","d": "2460","l": "see which ones you still need access to,"},{"t": "51740","d": "3120","l": "and if there are any, to switch your login from Facebook"},{"t": "54860","d": "1560","l": "to something else."},{"t": "56420","d": "1890","l": "So you can still access it even after you’ve"},{"t": "58310","d": "1650","l": "deleted your Facebook account."},{"t": "59960","d": "2490","l": "And there are just some apps that you won’t have access"},{"t": "62450","d": "1571","l": "to if you delete your Facebook account."},{"t": "67250","d": "2920","l": "Facebook has a lot of ways to track your activity"},{"t": "70170","d": "2780","l": "even if you’re not logged in or if you delete your account"},{"t": "72950","d": "4740","l": "entirely, and it uses what it calls the social graph"},{"t": "77690","d": "3030","l": "to track the activity of people across the internet"},{"t": "80720","d": "3090","l": "beyond just Facebook.com."},{"t": "83810","d": "2960","l": "This accounts for everyone who uses the internet,"},{"t": "86770","d": "3160","l": "and you don’t have to have a Facebook profile to be"},{"t": "89930","d": "1170","l": "tracked by Facebook."},{"t": "91100","d": "3060","l": "For example, if your friends have Facebook"},{"t": "94160","d": "2860","l": "accounts or Facebook Messenger accounts"},{"t": "97020","d": "3480","l": "and if they’ve uploaded their contacts to Facebook"},{"t": "100500","d": "1940","l": "and if you’re one of their contacts, then"},{"t": "102440","d": "2970","l": "Facebook knows your name and your phone number"},{"t": "105410","d": "6420","l": "and can track you. When you deactivate or delete"},{"t": "111830","d": "3150","l": "your Facebook profile, your profile disappears"},{"t": "114980","d": "3330","l": "and people can’t see what you posted or search for you."},{"t": "118310","d": "3330","l": "But all of the data that you gave over to third-party app"},{"t": "121640","d": "2260","l": "developers is still out there."},{"t": "123900","d": "2510","l": "And those developers are not required"},{"t": "126410","d": "2460","l": "to delete it or do anything with it."},{"t": "128870","d": "1638","l": "They can use it however they want."},{"t": "130508","d": "2032","l": "For as long as they want."},{"t": "132540","d": "2900","l": "There’s a whole list of ways that Facebook will track you"},{"t": "135440","d": "4410","l": "outside of Facebook.com. To do the full cleanse, you would have"},{"t": "139850","d": "3780","l": "to actually manually block a list of URLs that they"},{"t": "143630","d": "1080","l": "use to track you."},{"t": "144710","d": "2940","l": "These are the lengths you’d have to go to if you truly wanted"},{"t": "147650","d": "2870","l": "to get off of Facebook’s grid."},{"t": "900","d": "3000","l": "如果你看刪除臉書帳號的主題標籤，"},{"t": "3900","d": "1060","l": "你會發現人們非常生氣"},{"t": "4960","d": "1670","l": "我覺得人們開始"},{"t": "6630","d": "2040","l": "意識到自己有某種程度上"},{"t": "8670","d": "1800","l": "被監視及追蹤"},{"t": "10470","d": "3750","l": "對於許多臉書用戶來說，這是個轉捩點"},{"t": "14220","d": "2610","l": "他們因為不知道自己的資料是"},{"t": "16830","d": "1290","l": "如何被運用而很不開心"},{"t": "18120","d": "2400","l": "用戶若發現越多內幕，他們就越不開心"},{"t": "23349","d": "1541","l": "不過，我認為人們低估了"},{"t": "24890","d": "6142","l": "把自己從像是臉書這類的社群網絡解救出來的難度"},{"t": "31032","d": "1958","l": "所以，在你刪除你的臉書帳號之前，"},{"t": "32990","d": "2070","l": "請記住不光只有臉書"},{"t": "35060","d": "1530","l": "會被刪除"},{"t": "36590","d": "2580","l": "還有那些第三方的程式、"},{"t": "39170","d": "2760","l": "你曾接使用臉書登入、"},{"t": "41930","d": "3120","l": "或是和你的臉書帳號連結或連動的網站"},{"t": "45050","d": "1500","l": "所以在你刪除臉書之前"},{"t": "46550","d": "2730","l": "一定要瀏覽過這些與臉書連結的程式，"},{"t": "49280","d": "2460","l": "看看哪些你還需要使用，"},{"t": "51740","d": "3120","l": "如果有的話，把他們的臉書登入"},{"t": "54860","d": "1560","l": "改成其他的登入方式"},{"t": "56420","d": "1890","l": "所以即使刪除了臉書"},{"t": "58310","d": "1650","l": "你還是能登入這些網站"},{"t": "59960","d": "2490","l": "但，如果你刪除了臉書，"},{"t": "62450","d": "1571","l": "還是會有一些程式是你無法存取的"},{"t": "67250","d": "2920","l": "臉書有很多方式來追蹤你的活動"},{"t": "70170","d": "2780","l": "即使你沒有登入或甚至已經完全刪除臉書"},{"t": "72950","d": "4740","l": "臉書使用一個名為社交圖表的東西"},{"t": "77690","d": "3030","l": "來追蹤整個網路的使用者"},{"t": "80720","d": "3090","l": "這不光只有臉書的用戶"},{"t": "83810","d": "2960","l": "這個圖表是針對所有使用網路的人，"},{"t": "86770","d": "3160","l": "而且你不需要有臉書帳號"},{"t": "89930","d": "1170","l": "就會被臉書追蹤"},{"t": "91100","d": "3060","l": "舉例來說，如果你朋友有臉書帳號"},{"t": "94160","d": "2860","l": "或是 Messenger 的帳號"},{"t": "97020","d": "3480","l": "而他們有上傳他們的聯絡資訊到臉書"},{"t": "100500","d": "1940","l": "而你又是他們的聯絡人之一"},{"t": "102440","d": "2970","l": "如此一來，臉書就知道你的名字、號碼"},{"t": "105410","d": "6420","l": "然後追蹤你。當你關閉或刪除臉書帳號"},{"t": "111830","d": "3150","l": "你的主頁會消失，而其他人就無法"},{"t": "114980","d": "3330","l": "看到你的過去的貼文或是搜尋到你"},{"t": "118310","d": "3330","l": "但是你曾經給第三方程式開發者"},{"t": "121640","d": "2260","l": "的資料還是存在"},{"t": "123900","d": "2510","l": "而那些開發者並沒有被要求"},{"t": "126410","d": "2460","l": "要刪除或是採取其他行動"},{"t": "128870","d": "1638","l": "他們可以為所欲為"},{"t": "130508","d": "2032","l": "甚至沒有時間限制"},{"t": "132540","d": "2900","l": "臉書有一大堆方式來追蹤"},{"t": "135440","d": "4410","l": "你在臉書以外的活動要徹底清除，"},{"t": "139850","d": "3780","l": "你必須要手動封鎖"},{"t": "143630","d": "1080","l": "一長串的網址"},{"t": "144710","d": "2940","l": "而你所看到的這些就是你實際上要手動封鎖的網址"},{"t": "147650","d": "2870","l": "如果你真的想要完全擺脫臉書的話"}]}

