myObj = {"name":"Zero Waste Toothpaste","lyrics":[{"t": "130","d": "4330","l": "Hey everybody, this is Lauren from Trash is for Tossers and today I'm"},{"t": "4460","d": "2359","l": " I’m going to show you how to make Zero Waste"},{"t": "6819","d": "3030","l": "Toothpaste! I absolutely love this recipe."},{"t": "9849","d": "3231","l": "It's a great alternative to buying toothpaste in tubes that are either"},{"t": "13080","d": "2269","l": "difficult or impossible to recycle"},{"t": "15349","d": "3581","l": "It also works extremely well! I’ve been using it for years"},{"t": "18930","d": "4800","l": " and I still have almost all of my teeth! "},{"t": "23730","d": "3369","l": "And, its super quick and easy to make"},{"t": "27099","d": "4531","l": "So...let's get started! All we have to do is combine 2 tablespoons"},{"t": "31630","d": "4350","l": "of organic coconut oil"},{"t": "35980","d": "2710","l": "1 tablespoon of baking soda"},{"t": "42950","d": "2970","l": "and fifteen to twenty drops of organic essential oil"},{"t": "45920","d": "4650","l": "I like to use peppermint but you could also use anise, or cinnamon,"},{"t": "50570","d": "4520","l": "or spearmint... it's really whatever you prefer."},{"t": "55090","d": "3360","l": "And then, all you do is stir it together."},{"t": "58450","d": "3760","l": "I use this chopstick that I upcycled but you can use whatever you'd like."},{"t": "78860","d": "3560","l": "And there you have it! You just made toothpaste!"},{"t": "82420","d": "3310","l": "And so to use it all you do is take your toothbrush,"},{"t": "85730","d": "5110","l": "I like to use a compostable toothbrush, and a spoon"},{"t": "90840","d": "4680","l": "and then you scoop a little bit on there and you brush as you normally would."},{"t": "95520","d": "4300","l": "It's super, super simple. And you're done!"},{"t": "99820","d": "3580","l": "So here are a few things to consider. This toothpaste isn't going to foam up"},{"t": "103400","d": "3160","l": "and it might be a little bit saltier than you are used to. "},{"t": "106560","d": "3800","l": "Also, since the melting point of coconut oil is about 76 degrees Fahrenheit"},{"t": "111200","d": "4060","l": "or 24 degrees Celsius the consistency might fluctuate a little bit."},{"t": "115260","d": "3410","l": "So if it's hard just put it under some warm water for a few minutes"},{"t": "118670","d": "5470","l": "and if it's too liquid, just pop it in the freezer. Now you're ready to make Zero Waste toothpaste!"},{"t": "125100","d": "3000","l": "Thank you so much for watching, head to my channel (Trash is for Tossers),"},{"t": "128100","d": "3000","l": "or for more information head to my blog Trashisfortossers.com "},{"t": "130","d": "4330","l": "大家好，我是蘿倫，來自Trash is for Tossers"},{"t": "4460","d": "2359","l": "今天我要教你們怎麼做環保牙膏"},{"t": "6819","d": "3030","l": "我超喜歡這個配方的"},{"t": "9849","d": "3231","l": "這比去外面買管裝牙膏還要好得多"},{"t": "13080","d": "2269","l": "因為管裝牙膏很困難或是不可能回收"},{"t": "15349","d": "3581","l": "自製牙膏非常好用！我已經用了好幾年了"},{"t": "18930","d": "4800","l": " 我的牙齒大部分也都還在 "},{"t": "23730","d": "3369","l": "而且製作方法快速又簡單"},{"t": "27099","d": "4531","l": "所以我們開始做吧！我們需要加入兩大匙的"},{"t": "31630","d": "4350","l": "有機椰子油"},{"t": "35980","d": "2710","l": "一大匙的小蘇打粉"},{"t": "42950","d": "2970","l": "還有十五到二十滴的有機精油"},{"t": "45920","d": "4650","l": "我喜歡用胡椒薄荷的，但你也可以用大茴香或是肉桂的"},{"t": "50570","d": "4520","l": "或是荷蘭薄荷....這完全是看你的喜好決定"},{"t": "55090","d": "3360","l": "再來，把它全部攪拌混合"},{"t": "58450","d": "3760","l": "我用我再製的筷子攪拌，但你可以用其他東西攪拌"},{"t": "78860","d": "3560","l": "然後就完成了！你完成了自製的牙膏！"},{"t": "82420","d": "3310","l": "然後要用的時候，就拿起你的牙刷"},{"t": "85730","d": "5110","l": "我喜歡用生物可分解牙刷，然後還有湯匙"},{"t": "90840","d": "4680","l": "然後挖一小坨弄在牙刷上，然後就照平常那樣刷牙"},{"t": "95520","d": "4300","l": "這真的真的很簡單，然後就完成了！"},{"t": "99820","d": "3580","l": "再來有幾點要注意的。這種牙膏不會刷出泡泡"},{"t": "103400","d": "3160","l": "也可能會比你平常用的牙膏還鹹"},{"t": "106560","d": "3800","l": "然後，因為椰子油的熔點大約是華氏76度"},{"t": "111200","d": "4060","l": "或是攝氏24度，所以這牙膏的質地可能會稍微有變化"},{"t": "115260","d": "3410","l": "所以，如果牙膏變很硬，就用溫水沖幾分鐘"},{"t": "118670","d": "5470","l": "如果他太液態了，就把它放到冷凍庫裡。現在你已經知道要怎麼做環保牙膏了"},{"t": "125100","d": "3000","l": "非常謝謝你的觀賞，可以到我的頻道(Trash is for Tossers)"},{"t": "128100","d": "3000","l": "或是到我的部落格Trashisfortossers.com瞭解更多訊息"}]}

